import { Routes } from "react-router-dom";
import Products from "./components/Products";
import Welcome from "./components/Welcome";

function App() {
  return (
    <div>
      <Routes path="/welcome">
        <Welcome />
      </Routes>
      <Routes path="/products">
        <Products />
      </Routes>
    </div>
  );
}

export default App;
